import style from 'styled-components'

export const Container = style.div`
    display: flex;
    align-items: center;
    justify-content: space-around;
    flex-wrap:wrap;

    width:80%;
    margin:auto;
    background:coral;
`;

export const Div = style.div`
    width:500px;
` 

export const Button = style.button`
    background: blue;
    width:100%;
    margin-bottom:5px;
    padding:10px;

`
